            fired_reaction.reactants.forEach(r => { 
                const before = counts[r] || 0;
                counts[r] = before - 1;
            });
            fired_reaction.products.forEach(p => { 
                const before = counts[p] || 0;
                counts[p] = before + 1;
            });

